export default function Login() {
  return (
    <div>
      <div
        style={{
          display: "flex",
        }}
      >
        <img
          style={{
            height: "25px",
            width: "200px",
            marginTop: "20px",
            marginLeft: "20px",
            // border:"1px solid black"
          }}
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/a/ac/Semrush_logo.svg/2560px-Semrush_logo.svg.png"
          alt="semrush logo"
        />
      </div>
      <div
        style={{
          border: "1px solid black",
          height: "500px",
          width: "400px",
          textAlign: "left",
          marginLeft: "18%",
          marginTop: "150px",
        }}
      >
        <h2
          style={{
            fontSize: "26px",
          }}
        >
          Log in
        </h2>
        <button
          style={{
            textDecoration: "none",
            height: "40px",
            borderRadius: "5px",
            width: "80%",
            background: "none",
            fontSize: "17px",
          }}
        >
          <img
            style={{
              marginRight: "40px",
              marginLeft: "10px",
            }}
            src="https://www.semrush.com/static/images/IconGoogle.840359a84e4fa263c9995938755cb02f.svg"
            alt="google"
          />{" "}
          Log in with Google
        </button>
        <h5
          style={{
            textAlign: "center",
            fontSize: "14px",
          }}
        >
          or
        </h5>
        <label style={{ fontSize: "20px", color:"gray" }} htmlFor="">
          Email
        </label>
        <br />
        <input
          style={{
            width: "80%",
            height: "40px",
            marginTop: "20px",
            marginBottom:"20px"
          }}
          type="email"
          name="email"
          id="email"
        />
        <br />
        <label style={{ fontSize: "20px", color:"gray" }} htmlFor="">
          Password
        </label>
        <br />
        <input
          style={{
            width: "80%",
            height: "40px",
            marginTop: "10px",
          }}
          type="password"
          name="pass"
          id="pass"
        />
        <p
        style={{
            color:"red",
            textAlign:"right",
            fontSize:"14px",
        }}
        >Forgot your password?</p>
        <button
        style={{
            width:"80%",
            height:"40px",
            color:"white",
            backgroundColor:"#ff622d"

        }}>Log in</button>
      </div>
    </div>
  );
}
